 // 20px\n    --font-size-xxl: 1.5rem;   // 24px\n    --font-size-xxxl: 2rem;    // 32px\n    --font-size-xxxxl: 2.5rem; // 40px\n\n    // Three different text colors\n    --color-text-header: hsl(0, 1%, 16%);\n    --color-text-body:   hsl(0, 5%, 25%);\n    --color-text-muted:  hsl(0, 1%, 44%);\n\n    // Classical and robust spacing system\n    --space-xxxs: 0.25rem; // 4px\n    --space-xxs: 0.375rem; // 6px\n    --space-xs: 0.5rem;    // 8px\n    --space-s: 0.75rem;    // 12px\n    --space-m: 1rem;       // 16px\n    --space-l: 1.5rem;     // 24px\n    --space-xl: 2rem;      // 32px\n    --space-xxl: 2.5rem;   // 40px\n    --space-xxxl: 3rem;    // 48px\n    --space-xxxxl: 4rem;   // 64px\n\n    // Application colors\n    --color-primary:          #d6d0b8;\n    --color-primary-rotate:   rgb(23, 103, 223);\n    --color-primary-bg:       #5baaec;\n    --color-secondary:        #4c9173;\n    --color-secondary-rotate: #902424;\n    --color-tertiary:         hsl(49, 89%, 64%);\n    --color-glint:            rgb(163, 209, 255);\n\n    // Neutral colors\n    --color-white:      hsl(0, 0%, 100%);\n    --color-background: #33425b;\n    --color-light:      hsl(0, 6%, 93%);\n    --color-dark:       var(--color-text-header);\n\n    // Border radius\n    --border-radius: 0.375rem;\n\n    // Border\n    --border: solid 2px var(--color-light);\n    --border-dark: solid 2px var(--color-dark);\n\n    // Shadows\n    --shadow-large:  2px 4px 10px hsl(0 0% 0% / 0.1);\n    --shadow-small:  1px 3px 6px hsl(0 0% 0% / 0.1);\n    --shadow-light: 1px 3px 6px hsla(0, 2%, 35%, 0.911);\n}\n","*,\n*::before,\n*::after {\n  box-sizing: border-box;\n}\n\n* {\n  margin: 0;\n  padding: 0;\n}\n\nhtml {\n  overflow-y: scroll;\n  height: 100%;\n}\n\nbody {\n  display: flex;\n  flex-direction: column;\n  min-height: 100%;\n  background-image: linear-gradient(rgba(0, 0, 0, 0.5), rgba(0, 0, 0, 0.5)), url(../assets/images/radar02.jpg);\n  background-repeat: no-repeat; /* Prevents the image from repeating */\n  background-size: cover; /* Scales the image to cover the entire container */\n  background-position: center;\n\n  // background-color: var(--color-background);\n  color: var(--color-text-body);\n  line-height: var(--line-height-body);\n  font-family: var(--font-family-sans);\n}\n\nimg,\npicture,\nsvg {\n  display: block;\n  max-width: 100%;\n}\n\ninput,\nbutton,\ntextarea,\nselect {\n  font: inherit;\n}\n\nh1,\nh2,\nh3,\nh4,\nh5,\nh6 {\n  color: var(--color-primary);\n  line-height: var(--line-height-headers);\n  font-family: 'Rust';\n  font-weight: 500;\n}\n\nh1 {\n  font-size: var(--font-size-xxxl);\n}\n\nh2 {\n  font-size: var(--font-size-xxl);\n}\n\nh3 {\n  font-size: var(--font-size-xl);\n}\n\nh4 {\n  font-size: var(--font-size-l);\n}\n\na {\n  color: var(--color-primary);\n  text-decoration: none;\n  transition: color 200ms;\n\n  &:hover,\n  &:focus,\n  &:active {\n    color: var(--color-primary-rotate);\n  }\n}\n\n",'.container {\n    // border: var(--border-dark);\n    position: relative;\n    display: grid;\n    grid-template-columns: 1fr;\n    grid-template-rows: 0.6fr auto 0.2fr;\n    grid-template-areas:\n      "header"\n      "content"\n      "footer";\n\n    width: 100%;\n    height: 100%;\n    // padding-right: var(--space-xs);\n    // padding-left: var(--space-xs);\n    margin-left: auto;\n    margin-right: auto;\n    // margin-top: var(--space-l);\n    \n    border-radius: var(--border-radius);\n    // box-shadow: var(--shadow-small);\n    // background-color: var(--color-primary-bg);\n  \n    // background-color: transparent;\n\n    @include media(tabletAndUp) {\n      // padding-right: var(--space-m);\n      // padding-left: var(--space-m);\n      max-width: 60rem;\n    }\n  }',"@mixin media($query) {\n    @if $query == tabletAndUp {\n      @media (min-width: 50rem) { @content; }\n    }\n  }",".content {\n    grid-area: content;\n    // margin-top: 300px;\n    // border: var(--border-dark);\n    border-radius: var(--border-radius);\n\n    display: flex;\n    flex-direction: column;\n    // justify-content: space-around;\n}","footer {\n    grid-area: footer;\n    // margin-bottom: var(--space-l);\n    display: flex;\n    justify-content: end;\n    padding-bottom: var(--space-l);\n\n  .footer-name {\n\n  }\n  .author-icon {\n    vertical-align: middle;\n    display: inline-block;\n    padding-right: var(--space-s);\n  }\n  .footer_author a {\n    position: relative; /* Ensure the link is positioned */\n    display: inline-block; /* Ensure the link behaves as a block element */\n    color: var(--color-primary);\n    display: flex;\n    flex-direction: row;\n  }\n\n  .footer_author a::before {\n    content: url(../assets/images/icon_author_rotate.png);\n    position: absolute;\n    opacity: 0;\n    transform: rotateZ(180deg); /* Initial rotation state */\n    transition: opacity 0.3s ease, transform 2s ease; /* Smooth transition */\n  }\n\n  .footer_author a:hover::before {\n    opacity: 1;\n    transform: rotateY(0deg); /* Rotate back to original state on hover */\n  }\n}","header {\n    grid-area: header;\n    margin: var(--space-s);\n    // border: var(--border-dark);\n    border-radius: var(--border-radius);\n    \n    display: flex;\n    flex-direction: column;\n    justify-content: center;\n    align-items: center;\n    h1 {\n      font-size: 7rem;\n      // color: var(--color-text-header);\n    }\n  }",".sidebar {\n    grid-area: sidebar;\n    margin: var(--space-s);\n    border: var(--border-dark);\n    border-radius: var(--border-radius);\n    background-color: var(--color-secondary-bg);\n\n\n  }\n\n  .profile {\n    display: flex;\n    flex-direction: column;\n    .profile-title {\n      font-size: var(--font-size-xxl);\n      font-weight: bold;\n    }\n  }","// board.scss\n\n.board-container {\n    display: flex;\n    justify-content: space-between;\n    padding-top: var(--space-l);\n    gap: var(--space-l);\n}\n\n.board-cell {\n    // width: 50px; // Match the width in grid-template-columns\n    // height: 50px; // Match the height in grid-template-rows\n    border: 2px solid var(--color-primary); // Border to visualize grid cells\n    border-radius: var(--border-radius);\n    display: flex;\n    align-items: center;\n    justify-content: center;\n    background-color: var(--color-background);\n    cursor: pointer;\n    // box-shadow: var(--shadow-large);\n}\n\n.p1-board {\n    display: grid;\n    grid-template-columns: repeat(10, 35px); // Adjust the size based on your needs\n    grid-template-rows: repeat(10, 35px);\n    gap: 1px;\n    .board-cell {\n        transition: background-color 0.3s ease; \n    }\n    \n    .board-cell.water {\n        background-color: var(--color-primary-rotate); // Different color for 'water'\n    }\n    \n    .board-cell.ship {\n        background-color: var(--color-background); // Different color for ship\n    }\n    .board-cell.highlight-valid {\n        background-color: green;\n    }\n    \n    .board-cell.highlight-invalid {\n        background-color: red;\n    }\n}\n.p2-board {\n    // border: var(--border-dark);\n    display: grid;\n    grid-template-columns: repeat(10, 35px); // Adjust the size based on your needs\n    grid-template-rows: repeat(10, 35px);\n    gap: 1px; // Space between cells (optional)\n\n    .board-cell.water {\n        background-color: var(--color-secondary-rotate);\n        // background-color: rgb(23, 103, 223); // Different color for 'water'\n    }\n    \n    .board-cell.ship {\n       background-color: var(--color-secondary-rotate);\n        // background-color: rgb(23, 103, 223);// Different color for ship\n    }\n}\n","// _gameinfo.scss\n\n.game-info {\n    // border: var(--border-dark);\n    // color: var(--color-light);\n    display: flex;\n    flex-direction: column;\n    justify-content: space-between;\n    align-items: center;\n    \n    .top {\n        color: var(--color-light);\n        font-size: var(--font-size-xxxl);\n        font-weight: bold;\n        text-align: center;\n        display: flex;\n        flex-direction: column;\n        align-items: center;\n        // justify-content: center; \n        filter: brightness(1.2) contrast(1.2);\n        .feedback-image {\n            display: block;\n            align-items: center;\n        }\n    }\n    .top.sunk {\n        font-size: var(--font-size-xl);\n    }\n        \n    .top.fade-out {\n        animation: fadeOutAndShrink 10s forwards;\n    }\n    \n\n    .middle {\n        text-align: center;\n        font-size: 60px;\n        font-weight: 700;\n        color: var(--color-secondary-rotate);\n        filter: brightness(1.2) contrast(1.5);\n        text-shadow: \n            0 0 5px rgba(255, 255, 255, 0.8), /* White glow */\n            0 0 10px rgba(255, 255, 255, 0.6), /* White glow */\n            0 0 15px rgba(255, 255, 255, 0.4); /* White glow */\n            animation: none; /* Ensure no animation is applied initially */\n        }\n\n    .middle.sunk {\n        font-size: var(--font-size-xl);\n    }\n        \n    .middle.fade-out {\n        animation: fadeOutAndShrink 3s forwards;\n    }\n    \n    @keyframes fadeOutAndShrink {\n        0% {\n            opacity: 1;\n            transform: scale(1);\n        }\n        100% {\n            opacity: 1;\n            transform: scale(0.7); /* Shrinks the text to 50% of its original size */\n        }\n    }\n    @keyframes fadeOutAndShrink2 {\n        0% {\n            opacity: 1;\n            transform: scale(1);\n        }\n        100% {\n            opacity: 0;\n            transform: scale(0.7); /* Shrinks the text to 50% of its original size */\n        }\n    }\n\n    .bottom {\n        text-align: center;\n        font-size: var(--font-size-xl);\n        font-weight: 700;\n        color: var(--color-light);\n        filter: brightness(1.2) contrast(1.5);\n        // text-shadow: \n        //     0 0 5px rgba(255, 255, 255, 0.8), /* White glow */\n        //     0 0 10px rgba(255, 255, 255, 0.6), /* White glow */\n        //     0 0 15px rgba(255, 255, 255, 0.4); /* White glow */\n        //     animation: none; /* Ensure no animation is applied initially */\n    }\n\n    .bottom.fade-out {\n        animation: fadeOutAndShrink2 5s forwards;\n    }\n}\n\n.placement-info {\n    color: var(--color-light);\n}\n\n.direction {\n \n    h3 {\n        color: var(--color-light);\n    }\n}\n\n.changedirection {\n    font-size: var(--font-size-xs);\n    color: var(--color-light);\n    // padding-bottom: (var(--space-m));\n}","// _fleet.scss\n.fleet {\n    color: var(--color-primary);\n    display: flex;\n    flex-direction: row;\n    justify-content: space-between;\n    gap: var(--space-l);\n\n    background-image: url(../assets/images/battleship.png);\n    background-position: center;\n    background-size: 250px auto;\n    background-repeat: no-repeat;\n\n    .p1-fleet, .p2-fleet {\n        flex: 1;\n        margin-top: var(--space-m);\n        // padding: var(--space-s);\n        border-bottom: none;\n        border-radius: 50%;\n        border-width: 4px;\n    }\n    \n\n    .p1-fleet {\n        border-right: none;\n        border-color: var(--color-secondary);\n        legend {\n            font-family: 'Rust';\n            color: var(--color-primary);\n        }\n        .title {\n            padding-top: var(--space-xs);\n            h5 {\n                color: var(--color-white);\n            }\n        }\n        .ship{\n            display: flex;\n            gap: 1px;\n        }\n        .board-cell {\n            width: 20px; /* Adjust size as needed */\n            height: 20px;\n            background-color: grey; /* Default color for ship */\n        }\n        .board-cell.hit {\n            background-color: red; /* Color for hit */\n        }\n    }\n\n    .battleship-image {\n        background-image: url(../assets/images/battleship.png);\n        background-position: center;\n        background-size: cover;\n    }\n\n    .p2-fleet {\n        border-left: none;\n        border-color: var(--color-secondary-rotate);\n        legend {\n            font-family: 'Rust';\n            color: var(--color-primary);\n            text-align: right; /* Align text to the right */\n        }\n        .title {\n            padding-top: var(--space-xs);\n            display: flex;\n            justify-content: end;\n            h5 {\n                color: var(--color-white);\n            }\n        }\n        .ship{\n            display: flex;\n            gap: 1px;\n            justify-content: flex-end;\n        }\n        .board-cell {\n            width: 20px; /* Adjust size as needed */\n            height: 20px;\n            background-color: grey; /* Default color for ship */\n        }\n        .board-cell.hit {\n            background-color: red; /* Color for hit */\n        }\n    }\n}","dialog {\n    background-image: url(../assets/images/steelhull.jpg);\n    // overflow: hidden;\n\n    position: absolute; \n    top: 50%; \n    bottom: 50%;\n    left: 50%;\n    right: 50%; \n    transform: translate(-50%, -50%); /* Offsets the position by half of its own width and height to center */\n}\n\n\ndialog.start-game {\n    border: none;\n    box-shadow: none;\n    display: flex;\n    flex-direction: column;\n    text-align: center;\n    gap: var(--space-m);\n    padding: var(--space-l);\n    background: none;\n    background-color: transparent;\n\n    h1 {\n        color: #f3ebcf;\n        text-shadow: var(--shadow-light);\n    }\n}\n\ndialog.place-ships {\n    text-shadow: var(--shadow-large);\n    border: none;\n    border-radius: 8px; \n    background-color: var(--color-secondary);\n    // background-color: transparent;\n    display: flex; \n    justify-content: center;\n    align-items: center;\n    flex-direction: column;\n    padding: var(--space-xxl);\n    gap: var(--space-s);\n\n    h1 {\n        color: var(--color-text-header);\n    }\n    .p1-fleet {\n        color: var(--color-primary);\n        display: flex;\n        flex-direction: r